import React from "react";
import { useParams } from "react-router";
import {procesador} from "../Json/procesador.json"


const Prosec = ()=>{
    const Aprod  = procesador;

    const {id} = useParams()

    




return(
<div>
    <h1>{Aprod[id].title}</h1>
    <img src={Aprod[id].img}alt="prosesador" />
</div>

)


}

export default Prosec
